import React, {useState, useEffect}  from 'react'; 
function Test() { 
    const [click, setClick] = useState(0); 
    const [count, setCount] = useState(0); 

    useEffect(
        () => {
            setTimeout(
                () => {
                    setClick(click + 1)
                },100
            );
        },[count]
    );

    return ( 
        <div> 
            <p>You clicked {click} times and count is {count} <button onClick = { () => setCount(count + 1) } > 
                Click me 
            </button> </p> 



        </div> 
    ); 
} 
export default Test;
